import React, { useEffect, useState } from 'react'
import Accordion from '@mui/material/Accordion';
import AccordionSummary from '@mui/material/AccordionSummary';
import AccordionDetails from '@mui/material/AccordionDetails';
import Typography from '@mui/material/Typography';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';


const ManageSpace = () => {

    const [currentUser, setCurrentUser] = useState(JSON.parse(sessionStorage.getItem('user')))
    console.log(currentUser)

    const [spaceData, setSpaceData] = useState([])
    const [loading, setLoading] = useState(false)

    const fetchSpaceData = async () => {
        setLoading(true);
        const res = await fetch('http://localhost:5000/addSpace/getbyuser/' + currentUser._id)
        setLoading(false);
        console.log(res.status)

        if (res.status === 200) {
            const data = await res.json();
            console.log(data)
            setSpaceData(data)

        }
    }

    useEffect(() => {
        fetchSpaceData();
    }, [])

    const displayDetails = () => {

        if (!loading && spaceData) {
            return (
                <Accordion className='mt-3 border border-success rounded-6'>
                    <AccordionSummary
                        expandIcon={<ExpandMoreIcon />}
                        aria-controls="panel1a-content"
                        id="panel1a-header"
                    >
                        <Typography><h2>{spaceData.name}</h2></Typography>
                    </AccordionSummary>
                    <AccordionDetails>
                        <Typography>
                            <Typography>
                                Size : {spaceData.size} sq feet
                            </Typography>
                            <Typography>
                                Rate : {spaceData.rate} per hours
                            </Typography>
                            <Typography>
                                Location : {spaceData.location}
                            </Typography>
                            <Typography>
                                Facilities : {spaceData.facilities}
                            </Typography>
                        </Typography>
                    </AccordionDetails>
                </Accordion>
            )
        }

    }





    return (

        // <div className='container'>
        //     <Accordion className='mt-3 border border-success rounded-6'>
        //         <AccordionSummary
        //             expandIcon={<ExpandMoreIcon />}
        //             aria-controls="panel1a-content"
        //             id="panel1a-header"
        //         >
        //             <Typography><h2>Accordion 1</h2></Typography>
        //         </AccordionSummary>
        //         <AccordionDetails>
        //             <Typography>
        //                 <Typography>
        //                     Size : {spaceData.size} sq feet
        //                 </Typography>
        //                 <Typography>
        //                     Rate : {spaceData.rate} per hours
        //                 </Typography>
        //                 <Typography>
        //                     Location : {spaceData.location}
        //                 </Typography>
        //                 <Typography>
        //                     Facilities : {spaceData.facilities}
        //                 </Typography>
        //             </Typography>
        //         </AccordionDetails>
        //     </Accordion>
        // </div>

        <div className='container'>
            {displayDetails()}
        </div>
    )
}

export default ManageSpace
